export default function AustraliaMap({
  selectedStates,
  onStateToggle,
  onSelectAll,
  onClearAll,
}: AustraliaMapProps) {
  const isSelected = (state: string) => selectedStates.includes(state);
  const allSelected = selectedStates.length === 0 || selectedStates.length === allStates.length;

  const getStateFill = (state: string) => {
    if (selectedStates.length === 0) return '#E5E7EB';
    return isSelected(state) ? '#EE0B4F' : '#E5E7EB';
  };

  const getStateTextColor = (state: string) => {
    if (selectedStates.length === 0) return '#374151';
    return isSelected(state) ? '#FFFFFF' : '#374151';
  };

  return (
    <div className="flex flex-col items-center">
      {/* Toggle buttons */}
      <div className="flex gap-2 mb-3">
        <button
          onClick={onSelectAll}
          className={`px-3 py-1 text-xs font-medium rounded-full transition-all ${
            allSelected
              ? 'bg-[#EE0B4F] text-white'
              : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
          }`}
        >
          All States
        </button>
        <button
          onClick={onClearAll}
          className={`px-3 py-1 text-xs font-medium rounded-full transition-all ${
            selectedStates.length > 0 && selectedStates.length < allStates.length
              ? 'bg-gray-200 text-gray-700 hover:bg-gray-300'
              : 'bg-gray-100 text-gray-400'
          }`}
          disabled={selectedStates.length === 0}
        >
          Clear
        </button>
      </div>

      {/* Australia Map SVG - Professional paths from SimpleMaps */}
      <svg
        viewBox="0 0 1000 966"
        className="w-full max-w-[320px] h-auto"
        xmlns="http://www.w3.org/2000/svg"
        aria-label="Clickable Map of Australia"
      >
        <title>Clickable Map of Australian States</title>

        <g id="australian-states">
          {/* Render all states except ACT in the main map */}
          {allStates.filter(s => s !== 'ACT').map((state) => (
            <path
              key={state}
              d={statePaths[state]}
              fill={getStateFill(state)}
              stroke="#6B7280"
              strokeWidth="1"
              strokeLinejoin="round"
              strokeLinecap="round"
              className="cursor-pointer transition-all hover:opacity-80"
              onClick={() => onStateToggle(state)}
            />
          ))}
          
          {/* ACT in its actual position (small, for reference) */}
          <path
            d={statePaths['ACT']}
            fill={getStateFill('ACT')}
            stroke="#6B7280"
            strokeWidth="1"
            strokeLinejoin="round"
            strokeLinecap="round"
            className="cursor-pointer transition-all hover:opacity-80"
            onClick={() => onStateToggle('ACT')}
          />
        </g>

        {/* ACT Callout - Enlarged clickable area */}
        <g id="act-callout">
          {/* Connecting line from ACT position to callout */}
          <line
            x1="850"
            y1="685"
            x2="920"
            y2="780"
            stroke="#6B7280"
            strokeWidth="1.5"
            strokeDasharray="4,2"
            className="pointer-events-none"
          />
          
          {/* Callout circle background */}
          <circle
            cx="920"
            cy="830"
            r="45"
            fill={getStateFill('ACT')}
            stroke="#6B7280"
            strokeWidth="2"
            className="cursor-pointer transition-all hover:opacity-80"
            onClick={() => onStateToggle('ACT')}
          />
          
          {/* ACT label in callout */}
          <text
            x="920"
            y="838"
            textAnchor="middle"
            fill={getStateTextColor('ACT')}
            className="text-[22px] font-bold pointer-events-none"
          >
            ACT
          </text>
        </g>

        {/* Labels for states (except ACT which has its own callout label) */}
        <g id="labels" className="pointer-events-none">
          {allStates.filter(s => s !== 'ACT').map((state) => (
            <text
              key={`label-${state}`}
              x={labelPositions[state].x}
              y={labelPositions[state].y}
              textAnchor="middle"
              fill={getStateTextColor(state)}
              className="text-[24px] font-bold"
            >
              {state}
            </text>
          ))}
        </g>
      </svg>

      {/* Selected states indicator */}
      {selectedStates.length > 0 && selectedStates.length < allStates.length && (
        <p className="text-xs text-gray-500 mt-2">
          {selectedStates.length} state{selectedStates.length !== 1 ? 's' : ''} selected
        </p>
      )}
    </div>
  );
}
